OpcUa_StatusCode VlanSettingDataTypes::setVlanSettingDataTypes(OpcUa_Variant &variant, OpcUa_Boolean bDetach)
{
    clear();

    OpcUa_StatusCode ret = OpcUa_BadTypeMismatch;
    if (variant.Datatype == OpcUaType_ExtensionObject &&
        variant.ArrayType == OpcUa_VariantArrayType_Array)
    {
        ret = OpcUa_Good;
        m_noOfElements = variant.Value.Array.Length >= 0 ? variant.Value.Array.Length : 0;
        if (m_noOfElements > 0 && variant.Value.Array.Value.ExtensionObjectArray != OpcUa_Null)
        {
            m_data = (MoxaClassBased_VlanSettingDataType*)OpcUa_Alloc(m_noOfElements * sizeof(MoxaClassBased_VlanSettingDataType));

            OpcUa_UInt32 i = 0;
            for (i = 0; i < m_noOfElements; i++)
            {
                MoxaClassBased_VlanSettingDataType_Initialize(&m_data[i]);

                MoxaClassBased_VlanSettingDataType *pValue = MOXACLASSBASED_EXTENSIONOBJECT_GET_ENCODEABLE(VlanSettingDataType, &variant.Value.Array.Value.ExtensionObjectArray[i]);
                if (pValue)
                {
                    if (bDetach != OpcUa_False)
                    {
                        m_data[i] = *pValue;
                        MoxaClassBased_VlanSettingDataType_Initialize(pValue);
                    }
                    else
                    {
                        MoxaClassBased_VlanSettingDataType_CopyTo(pValue, &m_data[i]);
                    }
                }
                else
                {
                    ret = OpcUa_BadTypeMismatch;
                    break;
                }
            }
            if (OpcUa_IsNotGood(ret))
            {
                for (OpcUa_UInt32 j = 0; j < i; j++)
                {
                    MoxaClassBased_VlanSettingDataType_Clear(&m_data[j]);
                }
                OpcUa_Free(m_data);
                m_data = (MoxaClassBased_VlanSettingDataType*)OpcUa_Null;
                m_noOfElements = 0;
            }
        }
        else
        {
            m_noOfElements = 0;
        }
    }
    return ret;
}

OpcUa_StatusCode VlanSettingDataTypes::setVlanSettingDataTypes(OpcUa_Int32 length, MoxaClassBased_VlanSettingDataType* data)
{
    clear();

    if (length > 0 && data != OpcUa_Null)
    {
        m_noOfElements = length;
        m_data = (MoxaClassBased_VlanSettingDataType*)OpcUa_Alloc(m_noOfElements * sizeof(MoxaClassBased_VlanSettingDataType));
        for (OpcUa_UInt32 i = 0; i < m_noOfElements; i++)
        {
            MoxaClassBased_VlanSettingDataType_CopyTo(&(data[i]), &(m_data[i]));
        }
    }
    return OpcUa_Good;
}

